/**
 * Hello candidate, this is the index file which lands to the solution of your problem.
 * As you can see a rudimentry code has been implemented to load the feeds.
 * You have several API options available at your disposal to achieve your task.
 * They are documented below.
 */
import { fetchTweetsAfterId } from "./api";
import { Entry } from "./api/persistent-database";
import "./styles.css";

const app = document.getElementById("app")!;

let allTweets: Entry[] = [];
let displayedTweetIds = new Set<number>(); // Keep track of displayed tweet IDs
let interval: number;
let timeout: number;
let afterId = 0;

async function fetchApi() {
  try {
    const dbtweets = await fetchTweetsAfterId({ afterId, count: 10 });

    // Filter out tweets with duplicate IDs
    const newTweets = dbtweets.filter(
      (tweet) => !displayedTweetIds.has(tweet.id)
    );

    afterId = dbtweets[0].id;

    // Add new tweets' IDs to the displayedTweetIds set
    newTweets.forEach((tweet) => {
      displayedTweetIds.add(tweet.id);
    });

    allTweets = [...allTweets, ...newTweets];

    let html = "";

    allTweets.sort((a, b) => {
      return b.id - a.id;
    });

    allTweets.forEach((tweet) => {
      html += `
          <div class="tweet">
            ${tweet.id}
            <img src="${tweet.image}" width="50px" />
            <div class="tweet-text">${tweet.text}</div>
          </div>
        `;
    });
    app.innerHTML = html;
  } catch (err) {
    await fetchApi();
  }
}

fetchApi();

interval = setInterval(async () => await fetchApi(), 5000);

let oldValue = 0;
let newValue = 0;

window.addEventListener("scroll", (e) => {
  newValue = window.pageYOffset;

  if (oldValue < newValue) {
    clearInterval(interval); // Clear the interval
    clearTimeout(timeout);
  } else if (oldValue > newValue) {
    if (newValue === 0) {
      interval = setInterval(async () => await fetchApi(), 5000); // Restart the interval
    }
  }

  oldValue = newValue;
});
